import React, { Component } from 'react';
import { Navbar, Nav, NavItem } from 'react-bootstrap';
import { Link } from "react-router-dom";
import Home from '../../sections/Home/Home.js';

import './Navbar.css';


class NavBar extends Component {
  render () {
    return (
      <Navbar style={this.props.style} className="Navbar">
        <div className="container-fluid">
          <Nav pullLeft style={{display:"flex", flexDirection:"row"}}>
            <NavItem>
              <a href={Home}><p className="Navbar-item">nancy yao</p></a>
            </NavItem>
          </Nav>
          <Nav pullRight style={{display:"flex", flexDirection:"row"}}>
            <NavItem>
              <p className="Navbar-item">tech</p>
            </NavItem>
            <NavItem>
              <p className="Navbar-item">design</p>
            </NavItem>
            <NavItem>
              <p className="Navbar-item">sketches</p>
            </NavItem>
            <NavItem>
              <p className="Navbar-item">contact</p>
            </NavItem>
          </Nav>
        </div>
      </Navbar>
    )
  }
}

export default NavBar
